import React from 'react'

const ImageFetching = () => {

    
  useEffect(() => {
    axios
      .get("http://localhost:5000/courses")
      .then((res) => {
        setCourses(res.data);
      })
      .catch((error) => {
        console.error("Error fetching courses:", error);
      });
  }, []);
  return (
    <div>
      <h1>images</h1>
    </div>
  )
}

export default ImageFetching
